import React from 'react';
import Logo from './Logo.js'

export default class ToDoList extends React.Component {
    constructor() {
        super();
        this.state = {};
    }

    render() {
        return (
            <div className="mainMenu">
            <Grid container spacing={3}>
                <Logo/>
            </Grid>
            </div>
        )
    }
}
